B.HH=new A.fd("imdb","IMDb mobile app","Redesign UX/UI","This is a redesign of IMDb mobile app.  The main goal was to understand the relationship between users and this database and how they feed each other.\n          \nThrough time the consumption habits of this type of data have changed, going through specialized magazines and newspapers until reaching experiences of interaction with virtual reality.\n          \nThe massive growth of multimedia productions, partly caused by the need for home entertainment during the COVID-19 pandemic, and the urgent need to consume information at high speed is the scenario in which IMDb is inserted.","https://www.behance.net/gallery/137217303/IMDb-Mobile-Redesign",B.dM,B.Eo,!1)
B.HG=new A.fd("marriage","Marriage 365","UX Research","In this project I worked for Eazy Design Agency as part of the UX Research team.\n            \nThe main goal was research for a new mobile app for Marriage365 . This is a website specialized in consulting for couples and marriage advices.\n            \nI performed diferents task such as strategy, design, discovery and requirements.\n            \nWe conduct quantitative and qualitative research. Surveys (online, in depth, focus groups), remote interviews, gathering data and its subsequent analysis.\n            \nI also builded user personas, empathy and journey maps,  revealing user needs and pain points  for better understanding the end-to-end user journey.","",B.dM,B.bl,!1)
B.E4=A.b(s(["screenshot_1","screenshot_2","screenshot_3"]),t.s)
B.HI=new A.fd("patisserie","La Patisserie mobile app","UX/ UI Design","This was my first project  during my UX Design Google Course. It\u2019s a mobile app created for a French patisserie.\n          \nThe objective was to give to the customers an alternative to buy their pastries. This is a mobile shop application where the personas can buy pastries online without moving home.\n          \nThe project was born during pandemic times when de people can't go outside to buy groceries. Also, is designed for people who doesn't have time to go to the patisserie store because of the limited time after work or a busy day.","https://www.behance.net/gallery/126540663/La-Patisserie-App-Study-Case",B.dM,B.E4,!1)
